import React, { Component } from 'react';

class Mount extends Component {

    componentWillMount(){
        console.log('First this called');
      }

      getData(){
        setTimeout(() => {
          console.log('Our data is fetched');
          this.setState({
            data: 'Hello WallStreet'
          })
        }, 1000)
      }

      componentDidMount(){
        this.getData();
      }

      render() {
        return(
          <div>
          {this.state.data}
        </div>
        )
      }
    }


export default Mount;
